define({"topics" : [{"title":"Write Avro Pipeline","shortdesc":"\n                  <p class=\"shortdesc\">The Write Avro pipeline reads data from the origin, performs any required processing,         and uses a file-based Avro destination\n                     such as Local FS to write Avro files to a file         system. \n                  </p>\n               ","href":"datacollector\/UserGuide\/Processors\/WholeFileTransformer.html#concept_jsb_z1q_l2b","attributes": {"data-id":"concept_jsb_z1q_l2b",},"menu": {"hasChildren":false,},"tocID":"concept_jsb_z1q_l2b-d46e76569","topics":[]},{"title":"Parquet Conversion Pipeline","shortdesc":"\n                  <p class=\"shortdesc\">The Parquet Conversion pipeline processes the closed Avro files as whole files,         leveraging the efficiency of the whole\n                     file data format. This pipeline converts the Avro         files to Parquet using the Whole File Transformer processor.\n                  </p>\n               ","href":"datacollector\/UserGuide\/Processors\/WholeFileTransformer.html#concept_pf3_hbq_l2b","attributes": {"data-id":"concept_pf3_hbq_l2b",},"menu": {"hasChildren":false,},"tocID":"concept_pf3_hbq_l2b-d46e76594","topics":[]}]});